import React from 'react';
import { StyledBackgroundContainer } from '../../atoms';

export const Background = ({ backgroundUrl, ...props }) => {
    return (
        <StyledBackgroundContainer background={backgroundUrl}>
            {props.children}
        </StyledBackgroundContainer> 
    )
}
